"use client";
import { useEffect } from "react";
import { useRouter } from "next/navigation";

export default async function Searching() {
  const router = useRouter();
  useEffect(() => {
    const redirectToResult = () => {
      router.replace("/result");
    };

    const interval = setInterval(redirectToResult, 3000);

    return () => clearInterval(interval);
  }, []);

  return (
    <svg
      width="345"
      height="270"
      viewBox="0 0 345 270"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
    >
      <rect width="345" height="270" rx="24" fill="url(#pattern0_30_2467)" />
      <defs>
        <pattern
          id="pattern0_30_2467"
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use
            xlinkHref="#image0_30_2467"
            transform="matrix(0.00204427 0 0 0.00273485 -0.0361906 -0.13461)"
          />
        </pattern>
        <image
          id="image0_30_2467"
          width="512"
          height="512"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
}
